import Foundation

extension Dictionary where Value: Equatable {
    func allKeys(forValue val: Value) -> [Key] {
        return self.filter { $1 == val }.map { $0.0 }
    }
}


// Check if the input string is sherlock string.
// return value will string 'YES' or 'NO'
func isValid(s: String) -> String {
    
    //get the dictionary in [alphebeta: frequency] format
    var dict_frequency = s.reduce(into: [:]){
        counts, char in counts[char,default: 0] += 1
    }
   
     //group the same frequency to do the less searching
    let arr_frequency = Array(Set(dict_frequency.values).sorted())
    if arr_frequency.count == 1 {return "YES"} //the string is already a sherlock format
    if arr_frequency.count > 2 {return "NO"} // the group is larger than 2 , which means two more character has to be deleted, it is impossible to remove 1
    
    if arr_frequency.count == 2 {
    
        var arr_temp = dict_frequency.filter { $0.value == arr_frequency[0] }//find the grounp of char with same frequency
        print("\(arr_temp)")
        let num_char1 : Int = arr_temp.count
        if num_char1 == 1 {return "YES"}
        
        arr_temp = dict_frequency.filter { $0.value == arr_frequency[1] }
        print("\(arr_temp)")
       
        let num_char2 : Int = arr_temp.count
        if num_char2 == 1 && (arr_frequency[1] - arr_frequency[0] == 1 ){return "YES"}else{return "NO"}
        
    
        
    
    }else{
        return "NO"
    }
}

